import React from 'react';
import { Link } from "react-router-dom";

function Assignment6() {
    return (
        <div>
            <Link to="/">Lab</Link> |
            <Link to="/hello">Hello</Link> |
            <Link to="/tuiter">Tuiter</Link>
            <h1>Assignment 6</h1>
        </div>
    );
}
export default Assignment6;
